{
    "name": "jcc/blog",
    "description": "A full-featured, easy-to-use, well-expanded blog system powered by laravel and vuejs.",
    "keywords": ["blog", "laravel", "vue"],
    "license": "MIT",
    "type": "project",
    "require": {
        "php": "^7.3|^8.0",
        "dflydev/apache-mime-types": "^1.0",
        "erusev/parsedown": "^1.7",
        "fideloper/proxy": "^4.2",
        "guzzlehttp/guzzle": "^7.0.1",
        "intervention/image": "^2.4",
        "jcc/flysystem-upyun": "dev-master",
        "jcc/laravel-vote": "dev-master",
        "jcc/translug": "dev-master",
        "laravel/framework": "^9.0",
        "laravel/passport": "^10.0",
        "laravel/socialite": "^5.0",
        "laravel/tinker": "^2.0",
        "laravel/ui": "^4.2.2",
        "league/fractal": "^0.17",
        "league/html-to-markdown": "^4.8",
        "predis/predis": "^2.1.2",
        "spatie/laravel-permission": "^5.10.1",
        "symfony/http-client": "^6.3",
        "symfony/mailgun-mailer": "^6.3",
        "tucker-eric/eloquentfilter": "^3.2",
        "yzalis/identicon": "^2.0"
    },
    "require-dev": {
        "spatie/laravel-ignition": "^1.0",
        "fzaninotto/faker": "^1.9.1",
        "mockery/mockery": "^1.3.1",
        "nunomaduro/collision": "^6.1",
        "phpunit/phpunit": "^9.0"
    },
    "config": {
        "optimize-autoloader": true,
        "preferred-install": "dist",
        "sort-packages": true
    },
    "extra": {
        "laravel": {
            "dont-discover": []
        }
    },
    "autoload": {
        "psr-4": {
            "App\\": "app/",
            "Database\\Factories\\": "database/factories/",
            "Database\\Seeders\\": "database/seeders/"
        },
        "classmap": [
            "database/seeds",
            "database/factories"
        ],
        "files": [
            "app/Helpers.php"
        ]
    },
    "autoload-dev": {
        "psr-4": {
            "Tests\\": "tests/"
        }
    },
    "minimum-stability": "dev",
    "prefer-stable": true,
    "scripts": {
        "post-autoload-dump": [
            "Illuminate\\Foundation\\ComposerScripts::postAutoloadDump",
            "@php artisan package:discover --ansi"
        ],
        "post-root-package-install": [
            "@php -r \"file_exists('.env') || copy('.env.example', '.env');\""
        ],
        "post-create-project-cmd": [
            "@php artisan key:generate --ansi"
        ]
    }
}

